import React from "react";
import style from "./Support.module.css";
import Ticket from "../Ticket/Ticket";

const Message =(props) => {
    return(
    <div className={style.message}>{props.messagetext}</div>)
}
const Support = (props) =>{
    let ticketsData = [
        { id: 1, theme: "Не пришёл товар" },
        { id: 2, theme: "Долго грузится карточка товара" },
        { id: 3, theme: "Не нравится мне что-то на вашем сайте" },
        { id: 4, theme: "Купил паленый товар, верните денежку" },
        { id: 5, theme: "Ты чёрт" },
        { id: 6, theme: "Можно бесплатно?" },
        { id: 7, theme: "Как вернуть товар?" },
        { id: 8, theme: "Я не хочу больше этой хуйней заниматься" },
      ];
      
      return (
        <div className={style.Support}>
          <div className={style.supportwrapper}>
            <div className={style.tickets}>
              {ticketsData.map((ticket) => (
                <Ticket key={ticket.id} ticketid={ticket.id} ticketheme={ticket.theme} />
              ))}
            </div>
            <div className={style.chatcontainer}>
            <div >
                <Message messagetext="Привет"/>
                <Message messagetext="Как дела"/>
                <Message messagetext="Норм"/>
                <Message messagetext="Пока"/>
                <Message messagetext="Пока"/>
            </div>
            </div>
         </div>
        </div>
        
    );
}

export default Support;
